 heapq.heapify(temp)
 else:
 if v > temp[0][0]:
 heapq.heappop(temp)
 heapq.heappush(temp, (v, key))
 result = []
 while temp:
 v, key = heapq.heappop(temp)
 result.append(key)
 return result

